import { useEffect, useState } from "react";

function UsageCreate() {
  const [items, setItems] = useState([]);
  const [itemName, setItemName] = useState("");
  const [usageType, setUsageType] = useState("USE");
  const [amount, setAmount] = useState("");
  const [date, setDate] = useState("");
  const [message, setMessage] = useState("");

  // üîπ ITEMS LOAD
  useEffect(() => {
    fetch("/api/inventory/items")
      .then(res => res.json())
      .then(data => {
        console.log("üì• ITEMS RESPONSE:", data);

        if (Array.isArray(data) && data.length > 0) {
          setItems(data);
          setItemName(data[0].name); // ‚úÖ default select
        } else {
          setItems([]);
          setItemName("");
        }
      })
      .catch(err => {
        console.error("‚ùå ITEMS FETCH ERROR:", err);
        setItems([]);
      });
  }, []);

  // üîπ SUBMIT
  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage("");

    if (!itemName) {
      setMessage("‚ùå Please select an item");
      return;
    }

    const payload = {
      itemName: itemName,   // ‚úÖ BACKEND BEKLƒ∞YOR
      usageType,
      amount: Number(amount)
    };

    if (date) payload.date = date;

    console.log("üì§ USAGE PAYLOAD:", payload);

    try {
      const res = await fetch("/api/inventory/usage", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(payload)
      });

      const text = await res.text();
      console.log("üì• RAW RESPONSE:", text);

      let data;
      try {
        data = JSON.parse(text);
      } catch {
        data = { error: text };
      }

      console.log("üì• PARSED RESPONSE:", data);

      if (!res.ok) {
        console.error("‚ùå SERVER ERROR:", data);
        setMessage("‚ùå " + (data.error || "Internal Server Error"));
        return;
      }

      setMessage("‚úÖ Usage recorded successfully");
      setAmount("");
      setDate("");

    } catch (err) {
      console.error("‚ùå NETWORK ERROR:", err);
      setMessage("‚ùå Network error");
    }
  };

  return (
    <div style={{ maxWidth: 500 }}>
      <h2>Record Usage</h2>

      <form onSubmit={handleSubmit}>
        {/* ITEM */}
        <label>Item</label><br />
        <select
          value={itemName}
          onChange={e => setItemName(e.target.value)}
          required
        >
          {items.length === 0 && (
            <option value="">No items available</option>
          )}

          {items.map((item, index) => (
            <option key={`${item.name}-${index}`} value={item.name}>
              {item.name}
            </option>
          ))}
        </select>

        <br /><br />

        {/* TYPE */}
        <label>Usage Type</label><br />
        <select
          value={usageType}
          onChange={e => setUsageType(e.target.value)}
        >
          <option value="USE">USE</option>
          <option value="WASTE">WASTE</option>
          <option value="RECEIVE">RECEIVE</option>
        </select>

        <br /><br />

        {/* AMOUNT */}
        <label>Amount</label><br />
        <input
          type="number"
          step="0.01"
          value={amount}
          onChange={e => setAmount(e.target.value)}
          required
        />

        <br /><br />

        {/* DATE */}
        <label>Date (optional)</label><br />
        <input
          type="date"
          value={date}
          onChange={e => setDate(e.target.value)}
        />

        <br /><br />

        <button type="submit">Save</button>
      </form>

      {message && <p style={{ marginTop: 15 }}>{message}</p>}
    </div>
  );
}

export default UsageCreate;
